import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import './CreateSell.css';
import DragNdrop from '../../components';  // Импортираме компонента

const CreateSell = () => {
    const { id } = useParams();  // Взима ID-то от параметрите на роута

    const [formData, setFormData] = useState({
        id: id,  // Използва ID-то от роута
        entrance: '',
        floor: '',
        apartment: '',
        undergroundFloor: '',
        garage: '',
        parkingPlace: ''  // Променено от parkingPlaces на parkingPlace
    });

    const [errors, setErrors] = useState({});
    const [success, setSuccess] = useState(null);
    const [files, setFiles] = useState([]); // Добавяне на състояние за файловете

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const validateForm = () => {
        const newErrors = {};
        if (!formData.entrance) newErrors.entrance = 'Entrance Count is required';
        if (!formData.floor) newErrors.floor = 'Floor Count is required';
        if (!formData.apartment) newErrors.apartment = 'Apartment Count is required';
        if (!formData.undergroundFloor) newErrors.undergroundFloor = 'Underground Floor Count is required';
        if (!formData.garage) newErrors.garage = 'Garage Count is required';
        if (!formData.parkingPlace) newErrors.parkingPlace = 'Parking Place Count is required';  // Променено от parkingPlaces на parkingPlace

        return newErrors;
    };

    const handleFilesSelected = (selectedFiles) => {
        setFiles(selectedFiles);  // Обновяване на файловете, избрани от DragNdrop компонента
    };

    return (
        <div className="card mt-4">
            <h1>Register Sell</h1>
            <form>
                {success && <div className="alert alert-success">{success}</div>}
                <div className="form-group">
                    <label htmlFor="price">Contract Number</label>
                    <input
                        type="text" 
                        className="form-control no-spinner" 
                        placeholder="№"
                    />
                </div>

                {/* Драг и дроп меню */}
                <div className="form-group">
                    <label htmlFor="files">Upload Documents</label>
                    <DragNdrop onFilesSelected={handleFilesSelected} width="100%" height="200px" />
                </div>

                <div className="form-group">
                    <label htmlFor="price">Purchaser</label>
                    <input
                        type="text" 
                        className="form-control no-spinner" 
                        placeholder="First name"
                    />
                </div>
                <div className="form-group">
                    <input
                        type="text" 
                        className="form-control no-spinner" 
                        placeholder="Last name"
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="price">Broker</label>
                    <input
                        type="text" 
                        className="form-control no-spinner" 
                        placeholder="First name"
                    />
                </div>
                <div className="form-group">
                    <input
                        type="text" 
                        className="form-control no-spinner" 
                        placeholder="Last name"
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="price">Price</label>
                    <input
                        type="text" 
                        className="form-control no-spinner" 
                        placeholder="Price in €"
                    />
                </div>

                {/* Останалите SVG и бутона за създаване на продажба */}
                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-building-add" viewBox="0 0 16 16">
                    <path d="M12.5 16a3.5 3.5 0 1 0 0-7 3.5 3.5 0 0 0 0 7m.5-5v1h1a.5.5 0 0 1 0 1h-1v1a.5.5 0 0 1-1 0v-1h-1a.5.5 0 0 1 0-1h1v-1a.5.5 0 0 1 1 0"/>
                    <path d="M2 1a1 1 0 0 1 1-1h10a1 1 0 0 1 1 1v6.5a.5.5 0 0 1-1 0V1H3v14h3v-2.5a.5.5 0 0 1 .5-.5H8v4H3a1 1 0 0 1-1-1z"/>
                    <path d="M4.5 2a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm-6 3a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm-6 3a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5zm3 0a.5.5 0 0 0-.5.5v1a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5v-1a.5.5 0 0 0-.5-.5z"/>
                </svg>

                <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-car-front-fill" viewBox="0 0 16 16">
                    <path d="M2.52 3.515A2.5 2.5 0 0 1 4.82 2h6.362c1 0 1.904.596 2.298 1.515l.792 1.848c.075.175.21.319.38.404.5.25.855.715.965 1.262l.335 1.679q.05.242.049.489v4.5a.5.5 0 0 1-.5.5h-.803a.5.5 0 0 1-.5-.5v-.5H2.553v.5a.5.5 0 0 1-.5.5h-.803a.5.5 0 0 1-.5-.5v-4.5a3.008 3.008 0 0 1 .05-.49l.334-1.678a1.5 1.5 0 0 1 .965-1.262 1 1 0 0 0 .38-.404l.792-1.848ZM4.02 12h7.96c.094 0 .182-.06.213-.151l.518-1.554H3.29l.517 1.554a.224.224 0 0 0 .213.151ZM2.5 8c.276 0 .5.224.5.5v.5a.5.5 0 0 1-1 0v-.5c0-.276.224-.5.5-.5Zm10.5.5a.5.5 0 1 0-1 0v.5a.5.5 0 0 0 1 0v-.5ZM4.5 13a.5.5 0 1 0-1 0 .5.5 0 0 0 1 0Zm7 .5a.5.5 0 1 1-1 0 .5.5 0 0 1 1 0ZM6 5.5A.5.5 0 0 0 6.5 5h3a.5.5 0 0 0 0-1h-3a.5.5 0 0 0-.5.5Z"/>
                </svg>

                <button
                    type="submit"
                    className="btn btn-primary"
                    
                >
                    Create Sell
                </button>
            </form>
        </div>
    );
};

export default CreateSell;
